import React, { Component } from 'react';
import { Card, TextField, Button, Container } from '@material-ui/core';

class Login extends Component {
    render() {
        return (
            <div>
                <Container component="main" maxWidth="xs">
                    <Card style={{ padding: "12px" }}>
                        <form  noValidate>
                            <TextField variant="outlined" fullWidth type="email" id="standard-basic" label="Email" />
                            <TextField fullWidth type="password" id="standard-basic" label="Password" />
                            <Button type="submit" variant="contained">Sign In</Button>
                        </form>
                    </Card>

                </Container>

            </div>
        );
    }
}

export default Login;
